did.abstract:
Het archief bevat de neerslag van de handelingen van het Directoraat-Generaal voor Economische Structuur op het gebied van:
- technologie en innovatie; 
- kennisinfrastructuur;
- ruimtelijk economisch beleid;
- infrastructuur, milieu en ruimtelijke ordening;
- toerisme;
- marktwerking;
- mededingings- en ordeningsbeleid;
- ondernemerschap en midden- en kleinbedrijf

bioghist.p:
De taken van DG ES waren het behandelen van aangelegenheden betreffende:



technologie en innovatie;


kennisinfrastructuur;


ruimtelijk economisch beleid;


infrastructuur, milieu en ruimtelijke ordening;


toerisme;


marktwerking;


mededingings- en ordeningsbeleid;


ondernemerschap en midden- en kleinbedrijf.

DG ES bestond uit de volgende directies:
Directie Algemeen Technologiebeleid (ATB) met als taken:
formuleren van beleid op het terrein van technologie, kennis en ondernemersvaardigheden;
bevorderen van de aansluiting tussen de publieke infrastructuur voor onderzoek en onderwijs en het bedrijfsleven;
bevorderen van kennisdiffusie naar het bedrijfsleven;
bevorderen van acceptatie en integratie van technologie in de samenleving.
Directie Ondernemerschap en Midden- en Kleinbedrijf (OMKB) met als taken:
behandelen van beleidsaangelegenheden die van beleidsaangelegenheden die van belang zijn voor het midden- en kleinbedrijf (inclusief de zelfstandigen) als geheel, enerzijds door het inbrengen van het midden- en kleinbedrijf in een ander relevant overheidsbeleid, anderzijds met behulp van instrumenten op het gebied van vestigingsbeleid, onderwijs, voorlichting, advisering en financiering van onderzoek;
zorgdragen voor de afstemming van het nationale midden- en kleinbedrijfbeleid met het internationale midden- en kleinbedrijfbeleid;
Directie Marktwerking (DM): het beleidsterrein van DM bestrijkt niet alleen de nationale maar ook de internationale, met name de Europese, markt. De taak van DM was:
bevorderen van een vrije en economische werking van de markteconomie door het wegnemen van belemmeringen in de vorm van regels, afspraken en gedragingen in zowel publieke als private sfeer die niet in het algemeen belang zijn;
het voorkomen c.q. tegengaan van niet gewenste of niet aanvaardbare gevolgen van een vrije marktwerking
Directie Regio’s, Bedrijfsomgeving en Milieu (RBM) met als taken:
het realiseren van een ruimtelijk evenwichtige ontwikkeling van economische activiteiten en het bevorderen van een maximale bijdrage van de regio’s aan de nationale welvaartsontwikkeling;
het behartigen van economische belangen in relatie tot het rijksbeleid op het gebeid van milieu, ruimtelijke ordening, infrastructuur en mobiliteit;
het versterken van de bedrijfsomgeving, de verkeers- en vervoersinfrastructuur en de bestuurlijke omgeving waarin met name het internationaal georiënteerde bedrijfsleven moet opereren;
vergroten van de omvang van het toerisme in en naar Nederland;
integreren van (onderdelen van) het EZ-beleid in het beleid van lagere overheden en het leveren van een inbreng in het EZ-beleid vanuit de actuele regionale situatie.
Daarnaast viel ook de Dienst Rijksconsulenten nog onder DG ES. Deze dienst had tot taak het vertegenwoordigen van EZ in de regio door het uitdragen van EZ-beleid. Hiertoe waren een tiental rijksconsulentschappen ingericht. De Dienst Rijksconsulentschappen en de Rijksconsulentschappen vallen verder buiten deze bewerking.

